const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <p>&copy; 2024 React SEO Website. All rights reserved.</p>
        <p>Built with React and optimized for SEO</p>
      </div>
    </footer>
  );
};

export default Footer;
